-- Miraikakaku 包括的金融データベース初期化スクリプト
-- 生成日時: 2025-08-22 03:05:41
-- 総銘柄数: 12107銘柄
--   - 日本株: 4168社
--   - 米国株: 4939銘柄  
--   - ETF: 3000銘柄

USE miraikakaku_prod;

-- 既存データをクリア（日本以外も含む）
DELETE FROM stock_master WHERE country IN ('Japan', 'USA') OR currency IN ('JPY', 'USD');

-- 日本株データ投入

-- 米国株データ投入

-- ETFデータ投入

-- 投入結果検証
SELECT 
    country,
    currency,
    COUNT(*) as count,
    ROUND(COUNT(*) * 100.0 / 12107, 2) as percentage
FROM stock_master 
WHERE country IN ('Japan', 'USA') OR currency IN ('JPY', 'USD')
GROUP BY country, currency
ORDER BY count DESC;

-- 市場別集計
SELECT market, COUNT(*) as count 
FROM stock_master 
WHERE country IN ('Japan', 'USA') OR currency IN ('JPY', 'USD')
GROUP BY market 
ORDER BY count DESC;

-- 総数確認
SELECT 
    'Total Comprehensive Coverage' as description,
    COUNT(*) as total_stocks
FROM stock_master 
WHERE country IN ('Japan', 'USA') OR currency IN ('JPY', 'USD');
